INSERT INTO combatants (id, release_id, `name`, description, rarity_id, `limit`, section_id, health, attack, defense, dodge, strike, minimum_objects, maximum_objects, items_ratio, things_ratio, experience_reward, credit_reward, place_progress) VALUES
(1, 1, 'Wealthy Merchant', 'This merchant hurries along, clutching a satchel.  Something seems strange about him, and you watch as his eyes dart about not knowing anyone else in town.', 5, NULL, 6, 200, 6, 25, 5, 10, 2, 5, 9, 1, 5, 50, 1),
(2, 1, 'Low-Ranking Extremist', 'An extremist that seems a bit green but capable.  He hasn''t been entrusted with much to do but seems to be guarding this intersection with great pride.', 3, NULL, 2, 125, 5, 15, 0, 5, NULL, 3, 1, 1, 3, 15, 2),
(3, 1, 'High-Ranking Extremist', 'Battle-tested and strong, he looks very hard to defeat.  His scars show just how much combat he has seen, and his men seem to fear more than respect him.', 4, NULL, 2, 200, 8, 50, 5, 10, 1, 5, 1, 1, 6, 20, 4),
(4, 1, 'Evil Man', 'Vile and violent, he hides in the shadows. You watch him as he plays with a sharp knife and eyes innocent people as they pass by. This place would be much better without him, and he might have something you need.', 2, NULL, 6, 150, 5, 15, 0, 10, 1, 3, 1, 1, 3, 10, 2),
(5, 1, 'Drunk Extremist', 'It is a little early in the day, right? This extremist is totally drunk, and maybe high on a popular local drug mix. Watch out though, he is armed and dangerous.', 1, NULL, 2, 125, 5, 10, 0, 2, NULL, 3, 1, 1, 2, 10, 3),
(6, 1, 'Wild Camel', 'This 1000 pound animal just stomps the ground and waits to charge you. Just approaching him seems to make him very angry, and you can see there isn''t something right about him.', 1, NULL, 5, 100, 3, 10, 0, 5, NULL, 2, 1, 1, 1, NULL, 1),
(7, 1, 'Large Spider', 'A large and probably dangerous spider. This spider seems to be perched near an object that is worth investigating. You''ve seen plenty of spiders before and this one may be the biggest.', 1, NULL, 5, 150, 5, 5, 0, 5, NULL, 2, 1, 1, 1, NULL, 1),
(8, 1, 'Pack of Wild Dogs', 'You watch as this roaming pack of dogs tears through the trash and snaps up a small rodent. They seem vicious, uncared for, and very dangerous in a pack. The people you have been watching give them a wide berth.', 3, NULL, 5, 350, 10, 15, 0, 10, NULL, 2, 1, 1, 5, NULL, 2),
(9, 1, 'Wild Dog', 'You can tell that this dog is not a pet. He looks mangy and hungry, and one look in his eyes tells you he is feral.', 2, NULL, 5, 150, 5, 10, 0, 5, NULL, 2, 1, 1, 3, NULL, 1),
(10, 1, 'Water Snake', 'A poisonous snake swims up from the water. He slowly crawls towards you and just waits for a chance to attack. Do you go around it, or is the potentially-valuable object in the water worth the risk?', 1, NULL, 4, 200, 10, 10, 0, 10, NULL, 2, 1, 1, 2, NULL, 1),
(11, 1, 'Land Snake', 'This snake looks very dangerous and poisonous. He coils up slightly and prepares to strike.', 1, NULL, 5, 100, 5, 5, 0, 10, NULL, 2, 1, 1, 1, NULL, 1),
(12, 1, 'Scorpion', 'This scorpion is average in size and is probably full of poison.  Be very careful when disturbing it.', 1, NULL, 5, 200, 10, 15, 0, 5, NULL, 2, 1, 1, 3, NULL, 1),
(13, 1, 'Stray Cat Mustang', 'This brave cat has survived despite all odds in an environment of evil men and vicious dogs.  You want to befriend him, but first, a challenge is in order...', 5, NULL, 5, 300, 10, 25, 5, 10, 1, 2, 1, 1, 10, NULL, 1),
(14, 1, 'Smuggler', 'He is very important to the cause, regardless of which cause it might be this week. The only thing that matters is who can afford his services, or defeat him on the battlefield.', 3, NULL, 6, 250, 13, 10, 0, 5, 2, 3, 1, 1, 4, 25, 3);
